      <Route path="/user/unsuscribed" element={ <User/> } />
      <Route path="/newsletterList" element={<NewsletterList />} />
      <Route path="/newsletter" element={<Newsletter />} />     
      <Route path="/newsletterType" element={<AddTypeNewsletter />} />
    </Routes>
  </BrowserRouter>     

  );
}

export default App;
